    render() {
        return (
            <div>
                <footer className="site-footer">
                    <div className="container">
                        <div className="row">
                            <div className="col-6 col-sm-3 text-center">
                                <a className="btn btn-social-icon btn-instagram" href="http://instagram.com/"><i class="bi bi-facebook"></i></a>{' '}
                                <a className="btn btn-social-icon btn-facebook" href="http://www.facebook.com/"><i class="bi bi-instagram"></i></a>{' '}
                            </div>

                            <div className="col-sm-4 text-center">
                                <a role="button" className="btn btn-link" href="tel:+14109420001"><i class="bi bi-telephone-fill" />410-9420001</a>
                                <a role="button" className="btn btn-link" href="mailto:notreal@notreal.co"><i class="bi bi-envelope-fill"></i>campsites@nucamp.co</a>
                            </div>


                        </div>

                    </div>


                </footer>

            </div>
        )
    }
}
